import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Minesweeper from "../components/honcharuk-dmytro/Minesweeper";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/honcharuk-dmytro" element={<Minesweeper />} />
      </Routes>
    </Router>
  );
}

export default App;
